const NotFound = () => {
    return (
        <div className={err.root}>
            <h1 className={err.code}>404</h1>
            <h3 className={err.title}>Not Found</h3>
            <p className={err.description}>This route is not found. Please check url!</p>
        </div>
    )
}

export default NotFound;
